        React.createElement("path", { d: "M9.51 1.75a1 1 0 01.93.67l3.16 8.88a6.53 6.53 0 00-1.54 1.65l-2.6-7.32L6.6 13h5.42c-.39.6-.68 1.28-.85 2H5.83l-1.4 3.61a1 1 0 01-1.86-.72l6-15.5a1 1 0 01.94-.64zM17 16v3a.5.5 0 001 0v-3a.5.5 0 00-1 0zm1.25-2.25a.75.75 0 11-1.5 0 .75.75 0 011.5 0zM23 16.5a5.5 5.5 0 11-11 0 5.5 5.5 0 0111 0zm-1 0a4.5 4.5 0 10-9 0 4.5 4.5 0 009 0z", fill: primaryFill }));
};
const TextFontInfo24Filled = wrapIcon(rawSvg({}), 'TextFontInfo24Filled');
export default TextFontInfo24Filled;
